import Search from '../search/Search';



class listItem {
    constructor(bdDescr:string, bdAmount:number, bdFlag:boolean) {
    this.descrition = bdDescr;
    this.amount = bdAmount;
    this.flag = bdFlag;
    }
}


const List = () => {
    return(
        <div className='list'>
            <table>
                <thead>
                    <Search/>
                </thead>
                <tbody>
                    
                </tbody>
            </table>
        </div>      
    )
}

export default List;
